curl -XPOST 'http://localhost:9200/electronic_products/_create/1237' -H 'Content-Type: application/json' -d '{"product_name": "SGM8705", "table_name": "GENERAL DESCRIPTION", "content": "GENERAL DESCRIPTION  The SGM8705 is a dual, ultra-low power comparator,  which consumes only 300nA (TYP) supply current per  channel at 1.4V. The device can operate from 1.4V to  5.5V single supply, and is guaranteed to operate at 1.4V,  2.5V and 5V. It supports rail-to-rail input operation. The  above features make the SGM8705 a good choice for  battery-powered applications.  The SGM8705 has a push-pull output structure. When  driving any resistive or capacitive load, it is capable of  consuming the absolute minimum power.  The SGM8705 has a great trade-off between low power  and high speed, and the propagation delay is only 6μs  with 100mV overdrive at 1.4V.  In addition, the SGM8705 fits in small packages, so it is  also suitable for mobile phone and handheld electronic  devices.  The SGM8705 is available in Green SOIC-8 and  MSOP-8 packages. It is rated over the -40℃ to +85℃  temperature range.  "}'
